import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import InvNavBut from "../components/Invoice/InvNavBut";
import JobNavBut from "../components/JobEntry/JobNavBut";

class LandingPage extends React.Component {
    render() {
        return (
            <div className="jumbotron">
                <div>
                    <h1>Top Notch Plumbing</h1>
                    <p>Get started by clicking one of the buttons below.
                        </p>
                        <Row>
                            <Col> </Col>
                            <Col xs={6}><JobNavBut /></Col>
                            <Col></Col>
                        </Row>
                        <Row></Row>
                        <Row>
                            <Col></Col>
                            <Col xs={6}><InvNavBut /></Col>
                            <Col></Col>
                        </Row>
                </div>
            </div>
        );
    }
}

export default LandingPage;
